import{_ as r,c as n,a1 as t,G as a,w as l,B as i,o as h}from"./chunks/framework.C_1RMUpD.js";const F=JSON.parse('{"title":"Effects of mutations to rabies G on escape from monoclonal antibodies","description":"","frontmatter":{"aside":false},"headers":[],"relativePath":"escape.md","filePath":"escape.md"}'),c={name:"escape.md"};function m(p,e,u,d,f,_){const o=i("Altair"),s=i("Figure");return h(),n("div",null,[e[0]||(e[0]=t('<h1 id="effects-of-mutations-to-rabies-g-on-escape-from-monoclonal-antibodies" tabindex="-1">Effects of mutations to rabies G on escape from monoclonal antibodies <a class="header-anchor" href="#effects-of-mutations-to-rabies-g-on-escape-from-monoclonal-antibodies" aria-label="Permalink to &quot;Effects of mutations to rabies G on escape from monoclonal antibodies&quot;">​</a></h1><p>This page provides information on the effects of G mutations on escape from a panel of monoclonal antibodies in several ways:</p><nav class="table-of-contents"><ul><li><a href="#interactive-heatmaps">Interactive heatmaps</a><ul><li><a href="#heatmaps-for-individual-antibodies">Heatmaps for individual antibodies</a></li><li><a href="#lineplots-for-all-antibodies">Lineplots for all antibodies</a></li></ul></li><li><a href="#escape-on-structure-of-g">Escape on structure of G</a><ul><li><a href="#prefusion-trimer">Prefusion trimer</a></li><li><a href="#_17c7-in-complex-with-g">17C7 in complex with G</a></li><li><a href="#rva22-in-complex-with-g">RVA22 in complex with G</a></li><li><a href="#rvc20-in-complex-with-g-ph-domain">RVC20 in complex with G pH domain</a></li><li><a href="#cr57-in-complex-with-g-domain-iii">CR57 in complex with G domain III</a></li></ul></li><li><a href="#numerical-values">Numerical values</a></li></ul></nav><h2 id="interactive-heatmaps" tabindex="-1">Interactive heatmaps <a class="header-anchor" href="#interactive-heatmaps" aria-label="Permalink to &quot;Interactive heatmaps&quot;">​</a></h2><h3 id="heatmaps-for-individual-antibodies" tabindex="-1">Heatmaps for individual antibodies <a class="header-anchor" href="#heatmaps-for-individual-antibodies" aria-label="Permalink to &quot;Heatmaps for individual antibodies&quot;">​</a></h3><p>Here are links to interactive heatmaps of the effects of G mutations on escape from neutralization by each monoclonal antibody:</p><ul><li><a href="https://dms-vep.org/RABV_Pasteur_G_DMS/htmls/17C7_mut_effect.html" target="_blank" rel="noreferrer">antibody 17C7</a></li><li><a href="https://dms-vep.org/RABV_Pasteur_G_DMS/htmls/CR4098_mut_effect.html" target="_blank" rel="noreferrer">antibody CR4098</a></li><li><a href="https://dms-vep.org/RABV_Pasteur_G_DMS/htmls/RVA122_mut_effect.html" target="_blank" rel="noreferrer">antibody RVA122</a></li><li><a href="https://dms-vep.org/RABV_Pasteur_G_DMS/htmls/RVC58_mut_effect.html" target="_blank" rel="noreferrer">antibody RVC58</a></li><li><a href="https://dms-vep.org/RABV_Pasteur_G_DMS/htmls/CR57_mut_effect.html" target="_blank" rel="noreferrer">antibody CR57</a></li><li><a href="https://dms-vep.org/RABV_Pasteur_G_DMS/htmls/RVC20_mut_effect.html" target="_blank" rel="noreferrer">antibody RVC20</a></li><li><a href="https://dms-vep.org/RABV_Pasteur_G_DMS/htmls/CTB012_mut_effect.html" target="_blank" rel="noreferrer">antibody CTB012</a></li><li><a href="https://dms-vep.org/RABV_Pasteur_G_DMS/htmls/RVC68_mut_effect.html" target="_blank" rel="noreferrer">antibody RVC68</a></li></ul><p>As an example, below is the interactive heatmap showing escape from 17C7; clicking on the above links will open a similar standalone interactive heatmap for each antibody.</p>',8)),a(s,{caption:"Effects of mutations on escape from neutralization by antibody 17C7"},{default:l(()=>[a(o,{showShadow:!0,"spec-url":"htmls/17C7_mut_effect.html"})]),_:1}),e[1]||(e[1]=t('<p>The lineplot shows the total escape caused by all amino-acid mutations at each site in G (you can use the interactive options below the plot to show a different site statistics such as mean or max effect of any mutation at a site rather than the sum of mutation effects). The heatmap shows the escape caused by each mutation, with blue indicating mutations that cause escape (reduce neutralization). The <code>x</code> indicates the parental amino-acid in the Pasteur strain, and dark gray boxes indicate mutations that are too deleterious for cell entry to measure their effect on neutralization, while light gray boxes (which are present for only a few mutations) indicate no reliable measurement was made for that mutation. You can mouse over mutations in the heatmap for details including the measurement in each of the different experimental replicates. The mouseovers also report the effect of each mutation on cell entry (<code>functional effect</code>). The <code>times_seen</code> parameter in these mousevers represents how many different variants in the pseudovirus library had the mutation, and is an indication of the reliability of the measurement. Other options at the bottom of the plot allow you to specify additional filters or display options, including whether or not to <em>floor escape at zero</em> or show negative escape (mutations that increase neutralization). You can also filter to only show mutations with cell-entry scores better than some <em>minimum functional effect</em>; increasing this slider allows you to exclude mutations that are deleterious for cell entry. The zoom bar the top can be used to zoom into different regions of protein.</p><h3 id="lineplots-for-all-antibodies" tabindex="-1">Lineplots for all antibodies <a class="header-anchor" href="#lineplots-for-all-antibodies" aria-label="Permalink to &quot;Lineplots for all antibodies&quot;">​</a></h3><p>The above plots show escape for each individual antibody. <a href="https://dms-vep.org/RABV_Pasteur_G_DMS/htmls/all_antibodies_and_cell_entry_faceted.html" target="_blank" rel="noreferrer">This link</a> provides a set of lineplots that show escape from all of the different antibodies in one interactive plot.</p><h2 id="escape-on-structure-of-g" tabindex="-1">Escape on structure of G <a class="header-anchor" href="#escape-on-structure-of-g" aria-label="Permalink to &quot;Escape on structure of G&quot;">​</a></h2><p>You can interactively visualize the escape mutations projected onto G&#39;s structure using <a href="https://dms-viz.github.io/v0/" target="_blank" rel="noreferrer">dms-viz</a> at the following links:</p><p>The structures at the below links are colored by the total positive escape caused by mutations at each site; you can use the interactive options to plot other site statistics, change the protein representation, etc.</p><h3 id="prefusion-trimer" tabindex="-1"><a href="https://dms-viz.github.io/v0/?data=https%3A%2F%2Fraw.githubusercontent.com%2Fdms-vep%2FRABV_Pasteur_G_DMS%2Frefs%2Fheads%2Fmain%2Fresults%2Fdms-viz%2Fprefusion_ab_escape.json" target="_blank" rel="noreferrer">Prefusion trimer</a> <a class="header-anchor" href="#prefusion-trimer" aria-label="Permalink to &quot;[Prefusion trimer](https://dms-viz.github.io/v0/?data=https%3A%2F%2Fraw.githubusercontent.com%2Fdms-vep%2FRABV_Pasteur_G_DMS%2Frefs%2Fheads%2Fmain%2Fresults%2Fdms-viz%2Fprefusion_ab_escape.json)&quot;">​</a></h3><p>Click <a href="https://dms-viz.github.io/v0/?data=https%3A%2F%2Fraw.githubusercontent.com%2Fdms-vep%2FRABV_Pasteur_G_DMS%2Frefs%2Fheads%2Fmain%2Fresults%2Fdms-viz%2Fprefusion_ab_escape.json" target="_blank" rel="noreferrer">here</a> to visualize escape from all antibodies on the structure of prefusion G (PDB 7u9g). Initially the lineplot shows escape for all the antibodies overlaid; double-click on an antibody at the toolbar on the left to just show that antibody. Clicking on sites in the lineplot highlights them on the structure.</p><h3 id="_17c7-in-complex-with-g" tabindex="-1"><a href="https://dms-viz.github.io/v0/?data=https%3A%2F%2Fraw.githubusercontent.com%2Fdms-vep%2FRABV_Pasteur_G_DMS%2Frefs%2Fheads%2Fmain%2Fresults%2Fdms-viz%2Fprefusion_17C7_escape.json&amp;bc=%23cfafc7&amp;fi=%257B%2522cell_entry%2522%253A-5%257D" target="_blank" rel="noreferrer">17C7 in complex with G</a> <a class="header-anchor" href="#_17c7-in-complex-with-g" aria-label="Permalink to &quot;[17C7 in complex with G](https://dms-viz.github.io/v0/?data=https%3A%2F%2Fraw.githubusercontent.com%2Fdms-vep%2FRABV_Pasteur_G_DMS%2Frefs%2Fheads%2Fmain%2Fresults%2Fdms-viz%2Fprefusion_17C7_escape.json&amp;bc=%23cfafc7&amp;fi=%257B%2522cell_entry%2522%253A-5%257D)&quot;">​</a></h3><p>Click <a href="https://dms-viz.github.io/v0/?data=https%3A%2F%2Fraw.githubusercontent.com%2Fdms-vep%2FRABV_Pasteur_G_DMS%2Frefs%2Fheads%2Fmain%2Fresults%2Fdms-viz%2Fprefusion_17C7_escape.json&amp;bc=%23cfafc7&amp;fi=%257B%2522cell_entry%2522%253A-5%257D" target="_blank" rel="noreferrer">here</a> to visualize escape from antibody 17C7 mapped onto a structure of the antibody complex with prefusio G (PDB 8a1e). G can be colored by escape caused by mutations at each site. Click on sites in the lineplot to show them on the structure of G; the antibody is in pink.</p><h3 id="rva22-in-complex-with-g" tabindex="-1"><a href="https://dms-viz.github.io/v0/?data=https%3A%2F%2Fraw.githubusercontent.com%2Fdms-vep%2FRABV_Pasteur_G_DMS%2Frefs%2Fheads%2Fmain%2Fresults%2Fdms-viz%2Fprefusion_RVA122_escape.json&amp;fi=%257B%2522cell_entry%2522%253A-5%257D&amp;bc=%23e1c3e5" target="_blank" rel="noreferrer">RVA22 in complex with G</a> <a class="header-anchor" href="#rva22-in-complex-with-g" aria-label="Permalink to &quot;[RVA22 in complex with G](https://dms-viz.github.io/v0/?data=https%3A%2F%2Fraw.githubusercontent.com%2Fdms-vep%2FRABV_Pasteur_G_DMS%2Frefs%2Fheads%2Fmain%2Fresults%2Fdms-viz%2Fprefusion_RVA122_escape.json&amp;fi=%257B%2522cell_entry%2522%253A-5%257D&amp;bc=%23e1c3e5)&quot;">​</a></h3><p>Click <a href="https://dms-viz.github.io/v0/?data=https%3A%2F%2Fraw.githubusercontent.com%2Fdms-vep%2FRABV_Pasteur_G_DMS%2Frefs%2Fheads%2Fmain%2Fresults%2Fdms-viz%2Fprefusion_RVA122_escape.json&amp;fi=%257B%2522cell_entry%2522%253A-5%257D&amp;bc=%23e1c3e5" target="_blank" rel="noreferrer">here</a> to visualize escape from antibody RVA122 mapped onto a structure of the antibody complex with prefusion G (PDB u9g). G can be colored by escape caused by mutations at each site. Click on sites in the lineplot to show them on the structure of G; the antibody is in pink.</p><h3 id="rvc20-in-complex-with-g-ph-domain" tabindex="-1"><a href="https://dms-viz.github.io/v0/?data=https%3A%2F%2Fraw.githubusercontent.com%2Fdms-vep%2FRABV_Pasteur_G_DMS%2Frefs%2Fheads%2Fmain%2Fresults%2Fdms-viz%2Fph_domain_RVC20_escape.json&amp;bc=%23c6a9c5&amp;fi=%257B%2522cell_entry%2522%253A-5%257D" target="_blank" rel="noreferrer">RVC20 in complex with G pH domain</a> <a class="header-anchor" href="#rvc20-in-complex-with-g-ph-domain" aria-label="Permalink to &quot;[RVC20 in complex with G pH domain](https://dms-viz.github.io/v0/?data=https%3A%2F%2Fraw.githubusercontent.com%2Fdms-vep%2FRABV_Pasteur_G_DMS%2Frefs%2Fheads%2Fmain%2Fresults%2Fdms-viz%2Fph_domain_RVC20_escape.json&amp;bc=%23c6a9c5&amp;fi=%257B%2522cell_entry%2522%253A-5%257D)&quot;">​</a></h3><p>Click <a href="https://dms-viz.github.io/v0/?data=https%3A%2F%2Fraw.githubusercontent.com%2Fdms-vep%2FRABV_Pasteur_G_DMS%2Frefs%2Fheads%2Fmain%2Fresults%2Fdms-viz%2Fph_domain_RVC20_escape.json&amp;bc=%23c6a9c5&amp;fi=%257B%2522cell_entry%2522%253A-5%257D" target="_blank" rel="noreferrer">here</a> to visualize escape from RVC20 mapped onto a structure of the antibody complex with the pH domain of G (PDB 6tou). G can be colored by escape caused by mutations at each site. Click on sites in the lineplot to show them on the structure of G; the antibody is in pink.</p><h3 id="cr57-in-complex-with-g-domain-iii" tabindex="-1"><a href="https://dms-viz.github.io/v0/?data=https%3A%2F%2Fraw.githubusercontent.com%2Fdms-vep%2FRABV_Pasteur_G_DMS%2Frefs%2Fheads%2Fmain%2Fresults%2Fdms-viz%2FdomainIII_CR57_escape.json&amp;bc=%23c9acc5&amp;fi=%257B%2522cell_entry%2522%253A-5%257D" target="_blank" rel="noreferrer">CR57 in complex with G domain III</a> <a class="header-anchor" href="#cr57-in-complex-with-g-domain-iii" aria-label="Permalink to &quot;[CR57 in complex with G domain III](https://dms-viz.github.io/v0/?data=https%3A%2F%2Fraw.githubusercontent.com%2Fdms-vep%2FRABV_Pasteur_G_DMS%2Frefs%2Fheads%2Fmain%2Fresults%2Fdms-viz%2FdomainIII_CR57_escape.json&amp;bc=%23c9acc5&amp;fi=%257B%2522cell_entry%2522%253A-5%257D)&quot;">​</a></h3><p>Click <a href="https://dms-viz.github.io/v0/?data=https%3A%2F%2Fraw.githubusercontent.com%2Fdms-vep%2FRABV_Pasteur_G_DMS%2Frefs%2Fheads%2Fmain%2Fresults%2Fdms-viz%2FdomainIII_CR57_escape.json&amp;bc=%23c9acc5&amp;fi=%257B%2522cell_entry%2522%253A-5%257D" target="_blank" rel="noreferrer">here</a> to visualize escape from CR57 mapped onto a structure of the antibody complex with domain III of G (PDB 8r40). G can be colored by escape caused by mutations at each site. Click on sites in the lineplot to show them on the structure of G; the antibody is in pink.</p><h2 id="numerical-values" tabindex="-1">Numerical values <a class="header-anchor" href="#numerical-values" aria-label="Permalink to &quot;Numerical values&quot;">​</a></h2><p>For the effects of mutations on antibody escape after filtering for only high-confidence measurements, see <a href="https://raw.githubusercontent.com/dms-vep/RABV_Pasteur_G_DMS/refs/heads/main/results/summaries/all_antibodies_and_cell_entry_per_antibody_escape.csv" target="_blank" rel="noreferrer">this CSV file</a>. If you do not understand the details of the deep mutational scanning experiments and data analysis well enough to understand the data filtering parameters, then we recommend you use that pre-filtered file.</p><p>For more detailed values without pre-filtering for high confidence measurements, see the CSV files in <a href="https://github.com/dms-vep/RABV_Pasteur_G_DMS/tree/main/results/antibody_escape/averages" target="_blank" rel="noreferrer">this subdirectory</a>. Note that someof the mutations in that file may have low <code>times_seen</code> (number of variants containing the mutation) or <code>frac_models</code> (number of experiments in which the mutation was measured) and so be of lower confidence.</p>',19))])}const v=r(c,[["render",m]]);export{F as __pageData,v as default};
